public class InnerCampaignWriteTreatmentResourceFactory(Action<Humidifier.Pinpoint.CampaignTypes.WriteTreatmentResource> factoryAction = null) : SubResourceFactory<Humidifier.Pinpoint.CampaignTypes.WriteTreatmentResource>
{

    internal InnerCampaignMessageConfigurationFactory MessageConfigurationFactory { get; set; }

    internal InnerCampaignScheduleFactory ScheduleFactory { get; set; }

    internal InnerCampaignTemplateConfigurationFactory TemplateConfigurationFactory { get; set; }

    internal InnerCampaignCustomDeliveryConfigurationFactory CustomDeliveryConfigurationFactory { get; set; }

    protected override Humidifier.Pinpoint.CampaignTypes.WriteTreatmentResource Create()
    {
        var writeTreatmentResourceResult = CreateWriteTreatmentResource();
        factoryAction?.Invoke(writeTreatmentResourceResult);

        return writeTreatmentResourceResult;
    }

    private Humidifier.Pinpoint.CampaignTypes.WriteTreatmentResource CreateWriteTreatmentResource()
    {
        var writeTreatmentResourceResult = new Humidifier.Pinpoint.CampaignTypes.WriteTreatmentResource();

        return writeTreatmentResourceResult;
    }
    public override void CreateChildren(Humidifier.Pinpoint.CampaignTypes.WriteTreatmentResource result)
    {
        base.CreateChildren(result);

        result.MessageConfiguration ??= MessageConfigurationFactory?.Build();
        result.Schedule ??= ScheduleFactory?.Build();
        result.TemplateConfiguration ??= TemplateConfigurationFactory?.Build();
        result.CustomDeliveryConfiguration ??= CustomDeliveryConfigurationFactory?.Build();
    }

} // End Of Class

